import React from 'react';
import Header from './Components/Header/Header';
import { useController } from 'react-scroll-parallax'
function App() {
    useController().parallaxController.update();
    return (
        <div>
            <Header />
        </div>
    );
}

window.addEventListener('resize', (event) => {
    this.App();
});

export default App;
